import React from 'react';
import logo from './logo.svg';
import './App.css';
import ReactDOM from 'react-dom';
import Button from '@material-ui/core/Button'
import variant from '@material-ui/core/Button'
import 'bootstrap/dist/css/bootstrap.min.css';
import { Nav, NavDropdown,Navbar,Form, FormControl} from 'react-bootstrap';

function App() {
  return (
    <div className="App">
      <Navbar bg="light" expand="lg">

        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="mr-auto">
            <Nav.Link href="#home">JARVIS</Nav.Link>
            <Nav.Link href="#home">Nos Services</Nav.Link>
            <Nav.Link href="#link">Abonement</Nav.Link>
            <Navbar.Brand href="#home" >React-Bootstrap</Navbar.Brand>
          </Nav>
        </Navbar.Collapse>
            <NavDropdown title="Account" id="basic-nav-dropdown" className="mr-sm-2">
              <NavDropdown.Item href="#action/3.1">sign in</NavDropdown.Item>
              <NavDropdown.Item href="#action/3.2">Regester</NavDropdown.Item>
              <NavDropdown.Divider />
            </NavDropdown>
</Navbar>
    </div>
  )
}

export default App;
